import React from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './Collections.module.css';
import { BsCart3, BsBell } from 'react-icons/bs';
import { IoArrowBack } from 'react-icons/io5';

const styleCategories = [
  {
    id: 1,
    name: 'Casual',
    image: process.env.PUBLIC_URL + '/assets1/casual.jpg'
  },
  {
    id: 2,
    name: 'Trendy',
    image: process.env.PUBLIC_URL + '/assets1/trendy.jpg'
  },
  {
    id: 3,
    name: 'Polo Style',
    image: process.env.PUBLIC_URL + '/assets1/polo.jpg'
  },
  {
    id: 4,
    name: 'Sunny look',
    image: process.env.PUBLIC_URL + '/assets1/sunny.jpg'
  }
];

const Collections = () => {
  const navigate = useNavigate();

  return (
    <div className={styles.container}>
      <header className={styles.header}>
        <button className={styles.backButton} onClick={() => navigate('/catalog')}>
          <IoArrowBack size={24} />
        </button>
        <h1 className={styles.title}>Collections</h1>
        <div className={styles.headerIcons}>
          <button className={styles.iconButton}>
            <BsCart3 size={20} />
          </button>
          <button className={styles.iconButton}>
            <BsBell size={20} />
          </button>
        </div>
      </header>

      <nav className={styles.navigation}>
        <button className={`${styles.navButton} ${styles.active}`}>YOURS</button>
        <button className={styles.navButton}>TRENDING</button>
        <button className={styles.navButton}>ALL COLLECTIONS</button>
      </nav>

      <div className={styles.startCustomize}>
        Start Customise
      </div>

      <div className={styles.grid}>
        {styleCategories.map(category => (
          <div key={category.id} className={styles.card}>
            <div className={styles.imageContainer}>
              <img 
                src={category.image} 
                alt={category.name} 
                className={styles.image}
              />
              <div className={styles.label}>{category.name}</div>
            </div>
          </div>
        ))}
      </div>

      <button className={styles.addButton}>
        <span>+</span>
      </button>
    </div>
  );
};

export default Collections;
